    "2015-09-26T23:40:26.105052",nt"name": "rand-corporation-mean-monthly-global-snow-depth",nt"isopen":
    false,nt"url": null,nt"notes": "nAll available monthly snow depth climatologies
    were integrated   by the Rand Corporation, in the early 1980s, into one global (excluding
    Africa   and South America) digital data set gridded at 4&deg; latitude   x 5&deg;
      longitude. The U.S. Army Corps of Engineers monthly climatologies were a primary
      data source. For data-sparse areas such as China, Greenland, the Arctic and   Antarctica,
    special Rand methodologies were used: empirical evaluation of total  precipitation,
    weather source regions, latitude, temperature, terrain and annual   snow depth data.
    Monthly ice-pack limits from U.S. Navy Oceanographic Office  were used to extend
    the zero snow accumulation line over the oceans. These  mean monthly data can be
    used strictly as a climatological summary or for systematic   comparison with simulations
    from any general circulation model (GCM), or for   initiating GCM calculations.
    Data report copies are also available. The global   grid is too coarse to pick up
    snow accumulation in Africa and South America, but no more than two grid points
    are involved in these areas.n",nt"license_title": null,nt"extras": [{ntt"key":
